description:
This Advanced Ethical Hacking course from VTC will provide direction on tools and techniques for performing ethical hacking (also known as penetration testing). Author Ric Messier will cover Nessus, Nexpose, Nmap, and Metasploit, as well as manual testing techniques. He will also demonstrate Web Application Testing and various tools that will assist in that effort.


